<?php	require_once ("../lib/common/dao/VO.class.php");	class Cell extends VO {		private $itemVO;		private $tagVO;		private $itemid;		private $tagid;		private $celldata;		public function setItem($itemVO){			$this->itemVO=$itemVO;		}		public function getItem(){			return $this->itemVO;		}		public function setTag($tagVO){			$this->tagVO=$tagVO;		}		public function getTag(){			return $this->tagVO;		}		public function setItemid($itemid){			$this->itemid=$itemid;		}		public function getItemid(){			return $this->itemid;		}		public function setTagid($tagid){			$this->tagid=$tagid;		}		public function getTagid(){			return $this->tagid;		}		public function setCelldata($celldata){			$this->celldata=$celldata;		}		public function getCelldata(){			return $this->celldata;		}		public function __toString(){			return "itemid=".$this->itemid."(".$this->itemVO.")".", tagid=".$this->tagid."(".$this->tagVO.")".", celldata=".$this->celldata;		}	}?>